import React from 'react';
import './App.css';
import CreatureCard from './Components/CreatureCard'
import fish from './CreaturesJSON/CreaturesJSON';

const fishList = [...fish];


function App() {




  return (
    <div className="App">



      <div className="card-container">
        {fishList.map(fishy => (
          <CreatureCard
            name={fishy.name}
            location={fishy.location}
            price={fishy.price}
          />
        ))}
      </div>
    </div>
  );
}


export default App;
